commentBody:
Our current First Lady:

1. a legal immigrant who made a pile of cash on her own abilities;
2. A mother who is willing to sacrifice the limelight and her personal comfort for the sake of her young son;
3. A political wife who knows the value of a) not upstaging the President; and, b) who never leaks information;
4. A woman who can take the 'press trash talk' and keep on moving gracefully, beautifully, and respectfully;
5. A naturalized citizen who genuinely thinks that the USA is the best country in the world;
6. A wife who has been emotionally injured by her boorish husband but who is willing to do a "Dolly Parton" amd 'stand by your man', even when it hurts;
   I rest my case: a classy lady we can all be proud of!
